import axios from "axios";

const rssService = {
    endpoint: "https://theoldreader.com/post/all"
}

rssService.feeds = () => {
    const config = {
        method: "GET",
        url: rssService.endpoint,
        crossdomain: true,
        headers: {

            authorization: '59msf3yxmFBXjUnkg9ox'
        }
    }

    return axios(config)
}

export default rssService
